// Show/Hide tabs based on batch level and permissions
frappe.ui.form.on('Batch AMB', {
    refresh(frm) {
        // Level 1: Always show Tab 1, conditionally show others
        if (frm.doc.level === 1) {
            frm.toggle_display('level_2_section', frm.doc.__islocal ? false : true);
            frm.toggle_display('level_3_section', frm.doc.__islocal ? false : true);
        }

        // Level 2: Show tabs 1, 2, and conditionally 3
        if (frm.doc.level === 2) {
            frm.toggle_display('level_2_section', true);
            frm.toggle_display('level_3_section', frm.doc.__islocal ? false : true);
        }

        // Level 3: Show all tabs
        if (frm.doc.level === 3) {
            frm.toggle_display('level_2_section', true);
            frm.toggle_display('level_3_section', true);
        }

        // Reports tab: Always visible for saved documents
        frm.toggle_display('reports_section', !frm.doc.__islocal);
    }
});
